import { React, useState,useEffect } from 'react'
import "./Faculty.css"


let demoFaculties = [
  {
    name: 'Harunur Rashid',
    designation: 'Lecturer',
    image: 'https://cdn-icons-png.flaticon.com/512/847/847969.png',
    qualification: 'Bsc. (Hons), Msc. (Thesis), MPhil, PhD.',
    publications:[],
    email: 'www.google.com',
    profile: [
      {
        linkedInProfile: 'www.google.com',
        facebookProfile: 'www.facebook.com',
        googleScholarProfile: 'www.google.com',
        RechargeGateProfile: 'www.google.com'
      }
    ]
  },
  {
    name: 'Harunur Rashid',
    designation: 'Lecturer',
    image: '../assets/faculty4.jpg',
    qualification: 'Bsc. (Hons), Msc. (Thesis), MPhil, PhD.',
    publications:[],
    email: 'www.google.com',
    profile: [
      {
        linkedInProfile: 'www.google.com',
        facebookProfile: 'www.facebook.com',
        googleScholarProfile: 'www.google.com',
        RechargeGateProfile: 'www.google.com'
      }
    ]
  },
  {
    name: 'Harunur Rashid',
    designation: 'Lecturer',
    image: '../assets/faculty4.jpg',
    qualification: 'Bsc. (Hons), Msc. (Thesis), MPhil, PhD.',
    email: 'www.google.com',
    publications:[],
    profile: [
      {
        linkedInProfile: 'www.google.com',
        facebookProfile: 'www.facebook.com',
        googleScholarProfile: 'www.google.com',
        RechargeGateProfile: 'www.google.com'
      }
    ]
  },
]

export default function Faculties() {

  const [faculties, setFaculties] = useState(demoFaculties);

  useEffect(() => {
    fetch('http://localhost:4000/chemistry_lab/api/faculties')
       .then((res) => res.json())
       .then((data) => {
          console.log(data);
          setFaculties(data);
       })
       .catch((err) => {
          console.log(err.message);
       });
 }, []);


  return (
    <>
     <h1 className='heading'> Faculty Members<hr class="section-title-hr"/></h1>
      <div className='main-container'>
      {faculties.map((faculty) => (
        <div className="card-container">
          <div className="card" style={{ width: "34rem" }}>
            <img className="card-img-top" src={faculty.image} alt="Faculty image cap" />
            <div className="card-body">
              <h5 className="card-title">{faculty.name}</h5>
              <p className="card-text">{faculty.designation}</p>
              <a href="/" className="btn btn-link">View Details...</a>
            </div>
          </div>
        </div>
      ))}
    </div>
    </>

  )
}
